import React from 'react';
import background from './background.jpg'
import logo from './logo-blue.png'
import './App.css';

const App=()=>{
  return (
    <div className='App'>
      <img className='background' alt='IITH-hostel-background' src={background} />
      <img className='logo' alt='E-Cell Logo' src={logo} />
    </div>
  );
}

export default App;
